  [setup.config_stores]
    [setup.config_stores.polyfill_config]
      description = "Configuration data"

    [setup.config_stores.polyfill_config]
      [setup.config_stores.polyfill_config.items]
        [setup.config_stores.polyfill_config.items.generation]
          value = "1"
        [setup.config_stores.polyfill_config.items.log]
          value = "0"


[local_server]
  [local_server.backends]

  [local_server.config_stores]
    [local_server.config_stores.polyfill_config]
      format = "inline-toml"

